import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <button onClick={up}>+</button>
      <span>100</span>
      <button onClick={down}>-</button>
    </div>
  );
}

down = () => {
  console.log("111");
};

up = () => {
  console.log("111");
};

export default App;
